func resetTimeoutTicker(elementID string, seconds float64) templ.ComponentScript {
	return templ.ComponentScript{
		Name: `__templ_resetTimeoutTicker_f44f`,
		Function: `function __templ_resetTimeoutTicker_f44f(elementID, seconds){if (seconds <= 0) {
		return;
	}
	const btn = document.getElementById(elementID);
	const oldContent = btn.innerHTML.includes("(") ? btn.innerHTML.split("(")[0] : btn.innerHTML;

	btn.disabled = true;
	const getContent = (s) => {
		return oldContent + ` + "`" + `<span class="text-xs font-light">(${s})</span>` + "`" + `;
	}

	
	let secondsLeft = Math.ceil(seconds);
	btn.innerHTML = getContent(secondsLeft);
	const timeoutId = setInterval(()=> {
		secondsLeft = secondsLeft - 1;
		if (secondsLeft <= 0) {
			btn.disabled = false;
			btn.innerHTML = oldContent;
			clearTimeout(timeoutId);
			return;
		}
		btn.innerHTML = getContent(secondsLeft);
	}, 1000)
}`,
		Call:       templ.SafeScript(`__templ_resetTimeoutTicker_f44f`, elementID, seconds),
		CallInline: templ.SafeScriptInline(`__templ_resetTimeoutTicker_f44f`, elementID, seconds),
	}
}

